package lepton_test

import (
	"context"
	"fmt"
	"github.com/mylxsw/aidea-server/config"
	"github.com/mylxsw/aidea-server/pkg/ai/lepton"
	"github.com/mylxsw/go-utils/assert"
	"os"
	"testing"
)

func TestLepton_QRImageGenerate(t *testing.T) {
	conf := config.Config{
		LeptonAIQRServers: []string{"https://aiqr.lepton.run"},
		LeptonAIKeys:      []string{os.Getenv("LEPTON_API_KEY")},
	}

	client := lepton.Default(&conf)
	resp, err := client.QRImageGenerate(context.TODO(), lepton.QRImageRequest{
		ControlImage:      "",
		Model:             "2.5d",
		Prompt:            "exterior frontal perspective shot of resort villa inspired by Mykonos architecture, sea view visualization, white and blue colours mood, moody lighting, high quality, 8k, real, high resolution photography",
		ControlImageRatio: 0.75,
		ControlWeight:     1.28,
		GuidanceStart:     0.3,
		GuidanceEnd:       0.95,
		Seed:              -1,
		Steps:             30,
		CfgScale:          7,
		NumImages:         1,
	})
	assert.NoError(t, err)
	if err == nil {
		res, err := resp.SaveToLocalFiles(context.TODO(), "/tmp/")
		assert.NoError(t, err)

		fmt.Println(res)
	}
}
